n=a5.ib(b0,"1. Service Overview","Welcome to AssisMonter, a technology platform that provides personal assistance services with companionship. We connect users with professional, verified personal assistants who provide ride assistance and coordinate transportation services.\n\nAssisMonter is not a Transportation Network Company (TNC), transportation provider, medical transport service, or employer of personal assistants. We are a personal assistance service platform that facilitates connections between independent personal assistants and users.\n\nOur mission is to provide a safe, reliable, and compassionate platform for personal assistance and companionship while maintaining the highest standards of service quality and user satisfaction.")
m=a5.ib(b0,"2. Rider Requirements","By requesting a ride, you confirm that:\n\u2022 The rider is physically capable of walking to and from the vehicle without aid\n\u2022 No lifting or physical contact is required from the driver\n\u2022 No assistance is needed with medical devices (e.g., wheelchairs, walkers, oxygen tanks)\n\u2022 The rider can participate in shopping activities independently\n\u2022 The rider can communicate their needs clearly to the driver")
l=a5.ib(b0,"3. Personal Assistant Role & Independent Contractor Status","AssisMonter personal assistants are independent contractors, not employees of AssisMonter. They operate their own businesses, provide their own vehicles, and are responsible for their own insurance, licensing, and compliance with local regulations.\n\nAs independent contractors, personal assistants:\n\u2022 Are self-employed and responsible for their own taxes\n\u2022 Provide their own vehicles, insurance, and equipment\n\u2022 Set their own schedules and work availability\n\u2022 Are not entitled to employee benefits or protections\n\u2022 Have the right to accept or decline service requests\n\nTheir services include:\n\u2022 Coordinating transportation for users\n\u2022 Providing companionship and social support\n\u2022 Offering light assistance such as:\n  - Loading or unloading shopping bags (\u2264 25 lbs each)\n  - Guiding users to or from stores (without physical support)\n  - Verbal assistance and support during shopping\n  - Opening doors and pushing shopping carts\n\u2022 Providing courteous and professional personal assistance")
k=a5.ib(b0,"4. Personal Assistant Restrictions","AssisMonter personal assistants are not permitted to:\n\u2022 Push wheelchairs or provide physical assistance\n\u2022 Administer medications or medical treatments\n\u2022 Escort users into medical offices or homes\n\u2022 Provide medical care, diagnosis, or treatment\n\u2022 Handle medical equipment or devices\n\u2022 Provide personal care services (bathing, dressing, etc.)\n\u2022 Enter private residences beyond the doorway")
j=a5.ib(b0,"5. User Responsibilities","As a user of AssisMonter services, you agree to:\n\n\u2022 Provide accurate and complete information when booking services\n\u2022 Be ready at the scheduled pickup time\n\u2022 Treat personal assistants with respect and courtesy\n\u2022 Follow all applicable laws and regulations\n\u2022 Not request services that violate these terms\n\u2022 Pay for services as agreed upon\n\u2022 Report any issues or concerns promptly\n\u2022 Maintain appropriate behavior during services")
i=a5.ib(b0,"6. Service Conditions","All service requests must include accurate pickup, shopping, and drop-off locations.\n\nPersonal assistance services are only for users who can safely enter and exit the vehicle on their own.\n\nPersonal assistants may request assistance from the user if needed for safety purposes.\n\nFor security and compliance, AssisMonter reserves the right to cancel a service if the conditions above are not met.")
h=a5.ib(b0,"7. Liability & Disclaimer","As a personal assistance service platform, AssisMonter operates as an intermediary service and does not directly provide transportation services. Our liability is limited to the operation of our technology platform.\n\nAssisMonter does not assume liability for:\n\u2022 Health or safety issues arising from a user's medical condition\n\u2022 Accidents or injuries resulting from misuse of the service\n\u2022 Circumstances where a user requires more care than declared\n\u2022 Personal property loss or damage during transportation coordination\n\u2022 Delays due to traffic, weather, or other circumstances beyond our control\n\u2022 Actions or negligence of independent contractor personal assistants\n\nBy using the service, the user agrees that:\n\u2022 AssisMonter is not a healthcare provider, transportation provider, or employer\n\u2022 All services are non-medical and non-emergency\n\u2022 Use of the app does not create a healthcare, caregiver, or employment relationship\n\u2022 Users use the service at their own risk and agree to release AssisMonter, its affiliates, and its personal assistants from liability related to non-disclosed medical needs or service misuse\n\u2022 Personal assistants are independent contractors responsible for their own actions and compliance")
g=a5.ib(b0,"8. Cancellation & Refusal","AssisMonter personal assistants may refuse service if:\n\u2022 The user appears unable to walk safely without support\n\u2022 The situation violates the terms of this agreement\n\u2022 There is a safety, legal, or ethical concern\n\u2022 The user requires medical assistance beyond our scope\n\u2022 The user is under the influence of drugs or alcohol\n\u2022 The user behaves inappropriately or poses a safety risk")
f=a5.ib(b0,"9. Payment & Service Fees","All personal assistance services must be paid for through the AssisMonter app using approved payment methods.\n\nService fees may apply and will be clearly displayed before booking confirmation.\n\nPrices are subject to change based on demand, distance, and service type. Users will be notified of any fare changes before booking.")
e=a5.ib(b0,"10. Service State Requirements","Personal assistants must provide services only in their designated service state as registered in their profile.\n\nService state matching ensures compliance with local regulations and provides users with personal assistants familiar with their area.\n\nPersonal assistants may not provide services outside their registered service state without prior approval from AssisMonter.\n\nViolation of service state restrictions may result in account suspension or termination.")
d=a5.ib(b0,"11. Technology Platform & Business Model","AssisMonter operates as a personal assistance service platform and technology platform, not as a Transportation Network Company (TNC) or traditional transportation service provider.\n\nOur business model:\n\u2022 We provide digital infrastructure and technology to connect independent personal assistants with users\n\u2022 We do not own, operate, or maintain any vehicles\n\u2022 We do not employ personal assistants or provide transportation services directly\n\u2022 We facilitate transactions and provide user support for our platform\n\u2022 We earn revenue through platform fees and service charges\n\nWe coordinate transportation services but do not provide transportation services directly. Our focus is on personal assistance and companionship services.")
c=a5.ib(b0,"12. Privacy & Data","AssisMonter collects and processes personal data in accordance with our Privacy Policy.\n\nBy using our service, you consent to the collection and use of your information for service provision, safety, and improvement purposes.\n\nLocation data is collected only during active services for safety and service quality purposes.")
b=a5.ib(b0,"13. Updates","AssisMonter reserves the right to update these Terms of Service at any time. Users will be notified of significant changes through the app or email.\n\nContinued use of the service after changes indicates acceptance of the new terms. It is the user's responsibility to review the updated terms regularly.")
a=a5.ib(b0,"14. Intellectual Property","All content, features, and functionality of the AssisMonter platform, including but not limited to text, graphics, logos, software, and design elements, are owned by AssisMonter and are protected by copyright, trademark, and other intellectual property laws.\n\nUsers may not copy, reproduce, distribute, or create derivative works from any part of the platform without explicit written permission from AssisMonter.")
a0=a5.ib(b0,"15. Governing Law","These Terms of Service are governed by and construed in accordance with the laws of the jurisdiction in which AssisMonter operates.\n\nAny disputes arising from these terms or the use of our services will be resolved through appropriate legal channels in the applicable jurisdiction.")
